#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

int main()
{
    int n;
    cin >> n;
    vector<int> a(n);
    for (int i = 0; i < n; i++)
    {
        cin >> a[i];
    }

    int q = 0;
    for (int i = 0; i < n; i++)
    {
        for (int j = i + 1; j < n; j++)
        {
            if (a[i] > a[j])
            {
                q++;
                swap(a[i], a[j]);
            }
        }
    }

    cout << q << endl;
    for (int i = 0; i < n; i++)
    {
        cout << a[i] << " ";
    }
    cout << endl;

    return 0;
}

def main():
    n = int(input())
    a = list(map(int, input().split()))
    q = 0
    for i in range(n):
        for j in range(i + 1, n):
            if a[i] > a[j]:
                q += 1
                a[i], a[j] = a[j], a[i]
    print(q)
    print(' '.join(map(str, a)))


if __name__ == '__main__':
    main()

def get_input():
    n = int(input())
    a = list(map(int, input().split()))
    return n, a


def get_output(n, a):
    q = 0
    for i in range(n):
        if a[i] != i + 1:
            q += 1
            a[i], a[a[i] - 1] = a[a[i] - 1], a[i]
    print(q)
    print(' '.join(map(str, a)))


if __name__ == '__main__':
    n, a = get_input()
    get_output(n, a)
